const [loading, setLoading] = useState(false);

useEffect(() => {
  const findUserType = async () => {
    setLoading(true);
    const res = await authAxios.get(userTypeURL);
    setuserType(res.data);
    setLoading(false);
  };

  findUserType();
}, []);

function OrderIndex() {
  const { userType } = props;
